import React from 'react'
import { CircleImage } from './CircleImage'

export const BarList = (props) => {
    const data = [
        {title: "Appetizer Recipies", url: "./img/appetizer.jpg"},
        {title: "Breakfast and Brunch Recipies", url: "./img/breakfast.jpg"},
        {title: "Chicken Recipies", url: "./img/chicken.jpg"},
        {title: "Steak Recipies", url: "./img/steak.jpg"},
        {title: "Salad Recipies", url: "./img/salad.jpg"},
        {title: "Soup Recipies", url: "./img/soup.jpg"}
    ]
    return (
        <div className="bar-list-container">
            {data.map(({title, url}) => {
                return <CircleImage title={title} url={url}/>
            })}
        </div>
    )
}
